import { Scene } from "phaser";
import map_outlined_HQ from "../../public/assets/map_outlined_HQ.png";
import duck_colored from "../../public/assets/duck_colored.png";
import duck_outline from "../../public/assets/duck_outline.png";
import Logo_image from "../../public/assets/Logo_image.png";
import map1 from "../../public/assets/map1.png";
import map2 from "../../public/assets/map2.png";
import map3 from "../../public/assets/map3.png";
import playbtn from "../../public/assets/playbtn.png";
import PlayNow from "../../public/assets/PlayNow.png";
import VideoBG from "../../public/assets/VideoBG.png";
import Cursor_1 from "../../public/assets/Cursor_1.png";
import star from "../../public/assets/star.png";
import pixel_sprite from "../../public/assets/pixel.png";
import pixel_json from "../../public/assets/pixel.json";
import toArrayBuffer from "to-array-buffer";
import { adReady } from "../networkPlugin";


export class Preloader extends Scene {
  constructor() {
    super("Preloader");
  }

  init() {
    this.load.on("complete", () => {
      adReady();
    });
  }

  preload() {
    this.load.image("map_outlined_HQ", map_outlined_HQ);
    this.load.image("duck_colored", duck_colored);
    this.load.image("duck_outline", duck_outline);
    this.load.image("Logo_image", Logo_image);
    this.load.image("map1", map1);
    this.load.image("map2", map2);
    this.load.image("map3", map3);
    this.load.image("playbtn", playbtn);
    this.load.image("PlayNow", PlayNow);
    this.load.image("VideoBG", VideoBG);
    this.load.image("Cursor_1", Cursor_1);
    this.load.image("star", star);
    this.load.atlas("pixel", pixel_sprite, pixel_json);
    var duckClickSoundBase64 = 'data:audio/mp3;base64,';

    // Create an AudioContext
    const audioCtx = new (window.AudioContext || window.webkitAudioContext)();

    // Decode the Base64 string to an AudioBuffer
    audioCtx.decodeAudioData(toArrayBuffer(duckClickSoundBase64), (buffer) => {
      // Add the AudioBuffer to Phaser's audio cache
      this.cache.audio.add('duck_click_sound', buffer);
    }, (e) => {
      console.error("Error with decoding audio data", e);
    });
  }

  create() {
    this.scene.start("Game");
  }
}
